import Router from './Router'

export function RedirigirComponente(nombreRuta,nombreComponente,params){

    Router.$route.meta[nombreComponente] = params;
    Router.$router.push({name: nombreRuta});

}

export function ObtenerProps(nombreComponente){
    return Router.$route.meta[nombreComponente];
}
